INSERT INTO `request_unitbasicinfo` VALUES (5,'Atlanta Breakfast Club','cyrus','10BAUS100318032200C40018','(305) 753-3688',NULL,'249 Ivan Allen Jr Blvd NW,',NULL,'Atlanta','GA',30313,'(Unit installed 2 hrs ago) Customer lights the left side pilot, every thing is working fine but every time he lights the right side there is a big flame on the oven..Since this is a brand new Unit that’s having a problem , customer asking if He can replace the unit.',1,'The pilot can be lighted on: YES<br>The pilot can stay on: YES<br>The burner can be turned on: YES','NA','(000) 000-0000','DISPATCHER4@GMIAL.COM','2022-02-22','2018-06-12 16:06:18.079813','6/11/2018, ATLANTA, 3017141\r\nBilled To: Mr. V\'s Restaurant Equipment\r\nDealer picked up the unit',4,'Anna','Scheduled Time: 2022-02-22 22:22:00-06:00\nName: NA\nPhone: (000) 000-0000\nEmail: DISPATCHER4@GMIAL.COM\nNote: TESTING SYSTEM BY MANAGEMENT.\n\nScheduled Time: 2022-02-22 22:22:00-06:00\nName: NA\nPhone: (000) 000-0000\nEmail: DISPATCHER4@GMIAL.COM\nNote: TESTING SYSTEM BY MANAGEMENT.\n\nScheduled Time: 2022-02-22 22:22:00-06:00\nName: NA\nPhone: (000) 000-0000\nEmail: DISPATCHER4@GMIAL.COM\nNote: TESTING SYSTEM BY MANAGEMENT.\n','SKS062018-D4-1',1,'Customer or dealer drilled screws on the bottom to install casters. and made holes on the gas pipe.\r\nSo it is not  under warranty.   The person who drilled holes should take the responsibility.','2018-06-18 09:15:51.687470\nTESTING SYSTEM BY MANAGEMENT ','2018-06-18 14:16:19.578091','2018-06-18 09:16:00.781230\nCOMPLETE ','2018-06-18 14:16:19.578091','FFSHSF','','FDSDD','AL',76133,NULL,1),(6,'Dairy Queen','Hany','MSF8302AUS100317021500C40021','(727) 946-3558','','3101 66th St N','','St. Petersburg','FL',33710,'TEMP TOO HOT',0,'Filter Clean: Within 1 month\nDisplay Temperature: 58\nReal Temperature: 59\nController: Digital\nSnowflake Icon: ON\nFan Icon: ON\nIce on Evap: NO\nCond Fan Running: YES\nEvap Fan Running: YES\nCompressor running: NO\nDoor issue: NONE\n',NULL,NULL,NULL,